define({"topics":[{"title":"ဤလက်စွဲစာအုပ်ကိုအသုံးပြုနည်း","shortdesc":"<p class=\"shortdesc\">Kia ကားကို မောင်းနှင်ရာတွင် စိတ်ကျေနပ်မှု များနိုင်သမျှများများရအောင် ကျွန်ုပ်တို့က ကူညီပေးလိုပါသည်။ သင်၏ ကားပိုင်ရှင်လက်စွဲစာအုပ်သည် သင့်ကို နည်းလမ်းများစွာဖြင့် ကူညီပေးနိုင်ပါသည်။<\/p>","href":"topics\/id1894A0O60N4.html","attributes":{"data-id":"id1894A0O60N4"},"menu":{"hasChildren":false},"tocID":"id1894A0O60N4-d1148e19","topics":[]}]});